        public static GtoAction ConvertSolverAction(SolverActionType input)
        {
            return input switch
            {
                SolverActionType.Bet => GtoAction.Bet,
                SolverActionType.Call => GtoAction.Call,
                SolverActionType.Check => GtoAction.Check,
                SolverActionType.Fold => GtoAction.Fold,
                SolverActionType.Raise => GtoAction.Raise,
                _ => GtoAction.NoAction
            };
        }

        public static string ConvertPocket(string pocket)
        {
            string[] cards = new string[] { pocket.Substring(0, 2), pocket.Substring(2, 2) };

            string card;

            if (cards[0][0] == cards[1][0])
                card = cards[1][0].ToString() + cards[0][0];
            else
                card = cards[0][0].ToString() + cards[1][0] + (cards[0][1] == cards[1][1] ? "s" : "o");

            return card;
        }
    }
